import React from 'react';
import Styles from './SideBar.module.css'

const SideBar = () => {
    return (<>
        <div className="col-md-2 d-md-block d-none pl-0" id="sideBar">
            <div className="card">
                <div className={`card-body ${Styles.card - body}`}></div>
            </div>
        </div>
    </>);
}

export default SideBar;
